import React from 'react';

import Sections from './Components/Sections';
import Main from './Components/Main';
import { observer } from 'mobx-react';
import './App.css';

@observer
class App extends React.Component {
  constructor(props) {
    super(props);
  }

  changePage = () => {
    this.props.store.changePage('about');
    console.log(this.props.store.page, '<---------');
  }

  render = () => {
    console.log('entered');
    return (
      <div>
        <h1>{this.props.store.page}</h1>
        <button onClick={this.changePage}>CLICK</button>
      </div>
      // <div>
      //   <Sections store={this.props.store} />
      //   <Main store={this.props.store} />
      // </div>
    );
  }
}

export default App;
